(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d221dd5"],{cbbb:function(t,e,x){"use strict";x.r(e),e["default"]={name:"霍山黄芽",img:"\\huangcha\\huoshanhuangya\\img_201911221017021np9tf.jpg",desc:["霍山黄芽，安徽省霍山县特产，国家地理标志产品。霍山黄芽依其品质分为特一级、特二级、一级和二级。外形挺直微展，色泽黄绿披毫，香气清香持久，汤色黄绿明亮，滋味浓厚鲜醇回甘，叶底微黄明亮。2006年12月，霍山黄芽成功获批国家地理标志保护产品称号。"],menus:[{name:"霍山黄芽茶叶历史",content:[{text:"1950年春，中国茶叶公司皖北分公司在诸佛庵建起第一个\n        红茶\n        精制厂，用手工方式制作红茶102担，送上海口岸出口，受到苏联和东欧客商的好评。中国新茶讯社鉴评：“茶叶形状条子紧;碎末少;水色红浓，稍欠透明，香味甚佳。”"},{text:"1951年建“六安中心茶厂”，诸佛庵为分厂。"},{text:"1952年，苏联茶叶专家一行两人，来霍山考查了解“霍山红茶”品质。由此，内外山茶由黄大茶改为红茶，出口苏联、内蒙等地。"},{text:"1954年中国著名茶叶专家吴觉农教授来霍山考查茶叶产地、生产、品质情况。"},{text:"1958年，霍山红茶入选在新加坡举办的国际食品博览会，获好评，并作为全国红茶出口县之一。"},{text:"1959年3月18日，“六安中心茶厂”迁至霍山，改名为霍山县茶厂，5月23日，陈椽教授带领安农茶叶系学生来诸佛庵茶校实习，复制历史名茶“菊\n        花茶\n        ”成功。"},{text:"1966年，县庐剧团《茶山新歌》剧组赴省参加戏曲调演，受到上下一致好评，省电台播放该剧唱段。《茶山新歌》首次出现全国性的轰动效应。"},{text:"1969年，县茶叶工程师吴巧生、王惟杰受国家农业部派遣赴柬埔寨，传授茶叶生产加工技术。"},{text:"1970年元月12日。黄霍字(70)11号：“关于红茶改制\n        绿茶\n        报告”，上报省科委生产指挥部。71年2月批准由红茶改制炒青绿茶。"},{text:"1972年，庐剧《茶山新歌》改编成歌舞，参加全省汇演。刘家王景李儒瑶分获演唱二等奖和音乐创作一等奖。再次出现省内外轰动效应。"},{text:"1973年4月30日，中共霍山县佛子岭公社委员长给毛主席写了一封信，并寄去一包霍山黄芽。当年9月15日，中共中央办公厅信访处，给佛子岭公社回了信，并寄来茶款48元。"},{text:"1975年春，霍山县被列为安徽省10个年产干茶5万担县之一。"},{text:"霍山黄芽"},{text:"1980年，“雨茶一级8147”获全国供销合作总社优质食品奖。"},{text:"1984年，“舒绿珍眉茶”获省优食品奖。"},{text:"1985年春，县茶叶公司(又名县茶厂，实行一个机构两块牌子)试制新品种“乌农茶”成功。"},{text:"1985年，“珍眉一级9369”和“珍眉二级9368”双获部优产品。"},{text:"1988年，“特珍特级41022”和“特珍一级9371”，在希腊雅典食品评选会上，双获第27届世界优质食品银牌奖，得到安徽省政府通令嘉奖。县委、县政府在南岳山庄举行规模庞大的庆祝活动。"},{text:"1989年，一级雨茶和特珍特级被评为部优产品。"},{text:"1990年，霍山县茶厂获省劳动竞赛委员会创“优质服务”先进单位。"},{text:"黄芽部分"},{text:"1971年，霍山黄芽开始挖掘、研制，恢复生产。"},{text:"1972年4月27日-30日，县农业局茶叶生产办公室派茶叶技干胡翠成、李胜修、谢家琪在乌米尖同近八十高龄的詹绪纯等3位茶农共同炒制黄芽14斤，用白铁桶封装6斤上报国务院鉴评，作为国家招待贵宾之用。"},{text:"1973年，县土产公司又布点金鸡山、金竹坪、乌米尖三处制作霍山黄芽。此后，经反复切磋、试验，改进制作技术，新制黄芽178公斤。经安徽农学院、省农业厅、省供销社审评，投放市场后颇受青睐。后安徽农学院教授、著名茶叶专家、世界农业科技名人陈椽教授亲临现场教制“霍山黄芽”技术。霍山黄芽形、色、香、味进一步提高，从此声名远扬。"},{text:"1985年，霍山黄芽送广交会试销，深得国内外客户好评，远销香港等地。"},{text:"1986年，霍山黄芽被省商品局评为安徽省优质食品。"},{text:"1990年，霍山黄芽荣获中国商业部优质产品称号，一举成为中国名茶。这年，霍山黄芽经安徽省茶叶公司出口销往欧洲、香港、东南亚1000余公斤。"},{text:"1990年5月，国家科委在霍山南岳山庄召开了大别山地区茶叶产业研讨会。会上，著名茶叶专家、安徽农大教授王泽农到会题词。"},{text:"1990年，霍山翠芽(在霍山黄芽基础上新创名茶)获国家农业部优质产品奖。"},{text:"1990年9月，霍山县在全省第一个成立了茶叶产业协会，国家科委体改司副司长，国家科委驻皖开发团团长高级工程师朱传柏、省科委大别山开发办主任、省茶叶学会常务理事副研究员王兢、王汉权、农学院农业系统工程系主任副教授竺开华等为顾问。安农茶学系副教授叶银芳(当时任霍山县副县长)任理事长。1991年6月2日-5日，国家科委在霍山南岳山庄召开了由湖北、安徽、河南三省为主，江西、湖南等部分省派代表参加的“大别山茶叶产业开发研讨会”。国家科技部副主任马颜明，部长级顾问谢绍明，农业部司级巡视员黄继仁，安徽省科委主任常本英、省科委副主任丁俊美、中国农科院茶叶研究所研究员俞礼明，省科委大别山办公室主任研究员王竞，著名茶叶专家、安徽农业大学茶学系教授王泽农等参加了会议，国家外贸部，中国农科院茶科所也派领导和专家参加了会议。参会代表130余人，安徽省副省长张润霞到会讲了话。"},{text:"会议期间，与会代表参观了霍山诸佛庵茶山和茶厂。还举办了安徽省大别山名优茶产品展览。"},{text:"1994年10月，原林业部副部长徐有芳来霍山并题词说：“中国黄芽，精品之最”。1996年，霍山县举办首届黄芽茶文化节。安徽黄梅戏著名演员韩再芬率团来霍演出《女附马》。"},{text:"1998年，霍山举办第二届黄芽文化节，霍山中(国)荷(荷兰王国)扶贫项目办莫雷先生在会上讲话，著名黄梅戏演员马兰率团演出《红丝错》，主演黄新德、吴亚玲、马兰演折子戏。"},{src:"\\huangcha\\huoshanhuangya\\img_201911221017025yjlgq.jpg"}]},{name:"霍山黄芽茶叶特点",content:[{text:"霍山黄芽依其品质分为特一级、特二级、一级和二级。外形挺直微展，色泽黄绿披毫，香气清香持久，汤色黄绿明亮，滋味浓厚鲜醇回甘，叶底微黄明亮。"},{src:"\\huangcha\\huoshanhuangya\\img_20191122101702vtnr1q.jpg"}]},{name:"霍山黄芽加工工艺",content:[{text:"霍山黄芽原料要适时分批按标准进行采摘，采摘手法采用折采，总体要求幼嫩匀净。幼嫩即偏嫩采摘。匀净即匀齐一致，不带其他杂质，使外形整齐美观，达到形状、大小、色泽一致。采摘时严格进行拣剔，并做到“四不采”，即无芽不采，虫芽不采、霜冻芽不采、紫芽不采。采回经拣剔后薄摊在团簸内，厚约3-5公分，晴天露水叶摊放2-3小时，阴雨天摊放4-5小时，散发青草气和表面水份，待芽叶发出清香，叶色由鲜绿转为暗绿即可付制，一般上午采，下午制，鲜叶不过夜。 制作工艺包括杀青(生锅、熟锅)、毛火、摊放、足火、拣剔复火等五道工序。"},{text:"杀青"},{text:"分生锅、熟锅。生锅要求高温、快炒，锅温掌握120—130度左右，以鲜叶下锅后有炒芝麻声为度，叶片无炸边爆点。手炒每锅投叶量50—100克，鲜叶下锅后用双手或单手抹抖，抹得净，抖得开，充分散发水分，至叶软色暗时转入熟锅。做形手势是抓甩、抖翻结合，叶下锅后先炒，使叶受热均匀后四指并拢，拇指张开，抓住茶叶向锅内侧然后甩开直至当手感稍烫手时即改用抓抖散发水分，如此反复抓、甩、抖相结合，直至芽叶收拢呈雀舌形时出锅。。"},{text:"毛火"},{text:"温度110-120℃，投叶量3—4锅杀青叶，采取高温、翻勤、快烘，2人名左右翻烘一次，约烘5分钟至茶销有刺手感，香气溢出约七成干时下烘。"},{text:"焖黄"},{text:"毛火下烘时趁热摊放在团簸内，焖黄24-48小时至叶软微黄后上烘。"},{text:"足火"},{text:"烘顶温度90℃，投叶量为0.5-0.75公斤，每3-4分钟翻烘一次，翻烘动作要轻慢，历时15分钟，手握有刺手感，茶叶捻之即断碎，九成干时下烘摊凉即成黄芽毛茶。"},{text:"拣剔复火"},{text:"复火前拣去飘叶、黄片、红梗等杂质。拼配花色，使色泽一致。复火温度90℃左右，每烘笼投叶量1.5—2公斤，每4-5分钟翻一次，并随着茶叶干燥程度的提高逐次缩减，翻烘要轻、快、勤，时间15-20分钟，烘至茶叶手捻成末，茶香浓郁，白毫显露，下烘，趁热装筒。进入市场销售或入库保鲜。"},{src:"\\huangcha\\huoshanhuangya\\img_201911221017027zeg4i.jpg"}]},{name:"霍山黄芽储藏方法",content:[{text:"1、干燥贮藏：茶叶吸湿性强，含水量高时容易氧化变质，也会生霉变质。因此，茶叶必须干燥后贮存，贮存容器内必须放入适量的块石灰或干木炭等吸湿剂，以防返潮。"},{text:"2、低温贮藏：茶叶在低温时质变缓慢，高温时则容易变质。因此，茶叶必须在低温通风处贮存，有条件的可把装茶叶的容器密封后放入冰箱或冷库中贮存。"},{text:"3、防潮贮藏：防潮包装是选用防潮性能优良的包装材料和加入干燥剂而防止茶叶吸水的包装方法。"},{text:"4、避光贮藏：光线中的红外线会使茶叶升温，紫外线会引起光化作用，从而加速茶叶质变。因此，必须避免在强光下贮存茶叶，也要避免用透光材料包装茶叶;如用玻璃瓶或透光食品袋袋贮茶叶，应选茶色者为好。"},{text:"5、密封贮藏：氧化反应是茶叶质变的必须过程，如果断绝供氧则可制止氧化抑制质变。因此，必须隔氧密封贮藏茶叶。"},{text:"6、真空贮藏：真空包装贮藏是采用真空包装机，将茶叶袋内空气抽后立即封口，使包袋袋内形成真空装态，从而阻滞茶叶氧化变质，达到保鲜的目的。"},{text:"7、单独贮藏：茶叶具有极强的吸附性能，如与樟脑、汽油放在一起，马上可吸附其气体。因此，茶叶应单独贮藏。即装贮茶叶的容器不得混装其它物品。"},{text:"8、充氮贮藏：即用惰性气体二氧化碳或氮气来转换茶叶包装袋内的活性很强的氧气等空气，阻滞茶叶化学成分与氧的反应，达到防止茶叶陈化和劣变。"},{src:"\\huangcha\\huoshanhuangya\\img_20191122101702nz81n7.jpg"}]},{name:"霍山黄芽冲泡方法",content:[{text:'"茶兹于水，水籍于器，汤咸于火"。茶、水、器、火是泡茶的必要条件。要想泡好一杯茶，还须具备冲泡技艺。冲泡技艺包括对所泡茶叶的了解，对泡茶所需水温、时间的掌握，以及冲泡的手法、程序。不同的茶叶，有不同的冲泡方法，下面就霍山黄芽的冲泡方法简介如下：'},{text:"1.备器：冲泡黄芽宜用无色透明玻璃杯，以便更好地欣赏茶叶在水中上下翻飞、翩翩起舞的仙姿，观赏黄芽汤色、茸毫。此外还须备有水壶、茗炉、杯托等。"},{text:'2.择水：陆羽《茶经》云："山水上，江水中，井水正点"。泡茶用水以泉水、溪水、雪水、雨水为上，其次则为江河水。若用自来水，需静置24小时，以使氯气挥发掉。冲泡黄芽，要选择清轻甘活的软水。'},{text:'3.候汤："活水还须活火煎"，烧水要用武火急煮。冲泡黄芽的水温宜在80度左右，即古人所谓的"蟹眼汤"。'},{text:"4、洁杯：清洁茶杯。"},{text:"5.投茶：茶与水的用量比例适中，泡出来的茶就清香宜人。冲泡黄芽，茶叶与水的比例大致为1：50，即每杯投茶叶2克左右，冲水100毫升。"},{text:'6.浸润：候蟹眼乍起、松风欲鸣之时，采用"回旋注水法"，轻轻地将水沿杯子周边旋转着冲入，注水量约占杯容量的1/4-1/3。浸润时间20-60秒，目的使黄芽吸水膨胀，便于内含物的析出。'},{text:'7.冲泡：提高水壶，让水由高处向下冲去，并利用手腕的力量，将水壶由上向下反复提举三次，这一动作被称之为"凤凰三点头"。注入杯约七成左右，意为"七分茶，三分情"。"凤凰三点头"的作用，一是让杯中的茶叶在水的冲激下上下翻滚，促使茶叶中的有效成份迅速浸出;二是对宾客表示敬意，三点头象征着谦逊、真诚，如同行鞠躬礼。'},{text:"品饮技巧"},{text:"品饮之前，先赏茶汤，观色、闻香、赏形，然后趁热品啜茶汤的滋味。黄芽形似雀舌、嫩绿披毫，清香持久，滋味鲜醇浓厚、回甘，汤色黄绿、清澈明亮。第一泡品茶之鲜醇和清香;第二泡茶香最浓，滋味最佳，要充分体验茶汤甘泽润喉、齿颊留香、回味无穷的特征;第三泡时茶味已淡，香气亦减。三泡之后，一般不再饮了。"}]},{name:"霍山黄芽功效作用",content:[{text:"降脂减肥"},{text:"黄芽为不发酵自然茶，保留了鲜叶中的天然物质，富含氨基酸，茶多酚，维生素、脂肪酸等多种有益成分。茶多酚可以清除动脉血管壁上胆固醇的蓄积，同时抑制细胞对低密度脂蛋白胆固醇的摄取，从而达到血脂，预防和缓冲动脉硬化的目的。"},{text:"护齿明目"},{text:"牙组织的基本成份是氟、磷、石灰质，它使牙齿光滑坚硬，耐酸耐磨。黄芽茶叶含氟量较高，每公斤含氟约75-100毫克。因此，常饮茶能摄取足够的氟，以满足人体对氟的需求，对护牙坚齿是有好处的。而且茶水还可防龋齿。因人机体的抗龋能力与牙体硬组织内含氟元素的多少有关。常饮黄芽茶或用茶漱口，是防治龋齿的有效方法。"},{text:"益思提神"},{text:"黄芽含适量的咖啡碱，茶儿素的存在，使它的弊端不在体内发挥，而适量刺激骨胳肌，加速骨胳肌的收缩有兴奋中枢神经之功。加上茶叶中的挥发油清香芬芳，饮之令人心旷神怡，即有提神醒脑之效。在紧张工作、劳动之余，饮黄芽茶一杯可以振奋精神、解除疲乏;在办公时饮黄芽茶一杯可以提高功效。"},{text:"抗御辐射"},{text:"电脑辐射不仅危害我们的健康，而且影响到工作的质量和效率。经常使用电脑者可饮用黄芽茶，补充特异性植物营养素，消除因电脑辐射引起的黑眼圈。黄芽所含有的浓缩茶多酚，能抑制自由基对皮肤支持纤维造成破坏，是目前一致公认最有效的抗自由基因子。黄芽含有防辐射的有效成分，实验证明主要是茶多酚类化合物、脂多糖、维生素C、维生素E及部分氨基酸。其作用机理也是针对辐射引起量自由基并导致过氧化毒害而产生的解毒作用，茶多酚类化合物可以抗氧化和清除自由基，因而达到抗辐射效果，起着一种辐射保护剂的作用。"},{text:"增强免疫力"},{text:"人体具有其自身的免疫功能以抵抗外来微生物的侵袭，保持机体的健康。这种免疫防御系统是通过免疫蛋白体的形成以识别入侵人体的病原，然后由人体中的白血球和淋巴细胞产生抗体和巨噬细胞来行使围歼任务。饮茶可以提高人体中的白血球队和淋巴细胞的数量和活性以及促进脾脏细胞中白细胞间素的形成，因则增强了人体的免疫功能。"},{text:"抗衰益寿"},{text:"黄芽能让女人更美丽，那是毋庸置疑的。黄芽中不仅含有丰富的维生素C，其中的类黄酮，更有效地增加了维生素C的抗氧化功效。两者的结合中，对维持皮肤美白，年轻可说是有珍品的效果。"},{text:"食疗作用"},{text:"帮助消化，改善肠胃"},{text:"霍山黄芽茶叶中的儿茶素类化合物消除口臭有如下四方面的作用：①清除口腔中的口臭物质—甲基硫醇;②与口腔细菌作用的基质—氨基酸相结合;③对口腔中细菌有杀菌和制菌作用;④纯化口腔唾液中的酶类。"},{text:"饮霍山黄芽茶一方面可以消除口臭，另一方面可以有助于消化。这是因为茶叶中含有芳香物质，这类物质不但能刺激胃液分泌，有助于消化吸收，而且能消除胃中积垢，减轻口干、口臭等症状。"},{text:"作为碱性饮料，黄芽中的矿物质能中和酸性食物，保持人体体液的正常酸碱度(呈微碱性)，从而帮助人们远离“亚健康”、“富贵病”。加上黄芽中的鞣质具有摄制细菌的作用，咖啡碱又能增强胃液分泌，帮助消化，因此常饮黄芽茶，还能拥有强健的肠胃功能。"},{text:"生津止渴，消热解暑"},{text:"据《茶谱》记载：“人饮真茶能止渴”。《日用本草》中记载：茶能“除烦止渴”。在孙大缓着《茶谱外集》中：“夫其涤烦疗渴，换骨轻身，茶茗之利，其功若神。”饮茶可以解渴，人所共知。盛夏酷暑，一杯\n        绿茶\n        顿感满口生津。除了茶汤为人体补充水分外，还因为茶叶中的多酚类化合物、游离糖、氨基酸、维生素C和皂甙化合物与口腔中的唾液反应，使口腔得以湿润，产生清凉感觉，也起到明显止渴的效果。"},{text:"茶叶还是一种清热消火的饮料。中国著名古代医学家李时珍在《本草纲目》中写道：“茶苦而寒，阴中之阴，沉也，降也，最能降火，火为百病，火降则上清矣!”从中医学角度而言，茶叶，特别是绿茶，是一种清火的凉性食品。"}]},{name:"霍山黄芽历史故事",content:[{text:"清朝乾隆年间，霍山县新店河程家院有位叫程伯阶的，子承父业做茶叶生意，倒也财源茂盛，南来北往的客商们只要熟悉他的都称他“程茶客”。"},{text:"一日，他来到湖北省浠水县城作生意。半夜时分，由于口渴难忍，便翻身下床倒水。这时从隔壁隐约传来一阵阵呻吟声。程茶客推门进去，看见一位50多岁的人，面如腊纸，满头虚汗，一双手紧捂肚子低声呻吟着。"},{text:"好在程茶客早年学过几年医，一般的急病尚能对付。自己替那人诊脉后，认为那人只是饭食不均，偶感风寒，便从自己房中取来一包上等黄芽，沏了一壶酽茶，让那人趁热喝了几杯。几杯热茶下肚，那人腹痛渐止，不一会便呼呼地睡着。"},{text:"次日一早，程茶客买来许多精美点心，沏了一壶霍山金鸡山的黄芽，两人一见如故，一边喝茶，一边叙谈。那人告诉程茶客：“敝人姓赵，家住京城。昨日同几个同伴到此， 他们有事到英山去了，叫我在此等候，没想到昨夜身染重疾，若非客官照看，老朽今日恐不能与你共叙了。”"},{text:"程茶客说：“在家靠父母，出门靠朋友，我俩今日浠水相逢，也是三生有幸，我也是个生意人，四海为家，说不定那天就跑到京城找你呢!”"},{text:"姓赵的回答：“客官若到京城，请到寒舍一叙，彼此都是生意人，不用客气，不知客官现在做何生意。 ” 程茶客告诉赵姓人士，自己做茶叶生意。"},{text:"姓赵的又问：“昨晚腹痛难捺，不知贤弟用何良药解除我的病情?” 程茶客答：“夜深人静，哪有良药。小弟就是用霍山黄芽茶治好了仁兄的病。”"},{text:"那人闻听，十分惊讶，便说：“我在京城多年，喝尽天下名茶，从来没有喝到这样好茶，不知此茶何名，产于何地?”"},{text:"程茶客便揭开壶盖，见壶内茶叶形似雀舌，细嫩多绒，冲入开水，云雾缭绕，香气四溢。程茶客又敬了一杯茶给那人。接着把霍山流传的金鸡山神茶的传说说了一遍。那人听完故事后，连声说：“好茶!好茶!”"},{text:"赵姓人士留给程茶客一块黄绫，作为去京城找他的信物。次日凌晨，两人长亭话别，各奔东西。"},{text:"第二年春茶季节，程茶客想起在浠水遇到的那位姓赵的客商，心想京城乃繁华之地，何不藉此机会游览一番，还可做做生意，会会朋友。"},{text:"程茶客一路风霜来到京城，凭藉黄绫找到赵姓人士，才发现他原来就是当朝乾隆皇帝。自此，每年春茶季节，官府都要派人到霍山大化坪金鸡山收购定点采摘、专人烘制的霍山黄芽作为贡品，送给乾隆皇帝品尝。"}]},{name:"霍山黄芽获奖情况",content:[{text:"七十年代以来，霍山黄芽每年都特贡中央国家机关为办公用茶。"},{text:"1915年，霍山黄芽荣获巴拿马万国博览会金质奖。"},{text:"1990年霍山黄芽获商业部农副产品优质奖;"},{text:"1993年霍山黄芽获安徽省科技进步四等奖、全国“七五”星火计划银奖;"},{text:"1999年霍山黄芽获第三届“中茶杯”全国名优茶评比一等奖;"},{text:"2000-2004霍山黄芽连续五年获国际茶博览交易会名茶评比金奖;"},{text:"2000年500克极品霍山黄芽在安徽省博物馆以11800元高价成功拍卖，并被中国茶叶博物馆收藏;"},{text:"2001年霍山黄芽获中国杭州国际茶叶博览交易会国际名茶评比金奖，并获2001年日本茶叶评比大奖;"},{text:"2001年霍山黄芽是第八届上海国际茶文化节唯一推荐产品;"},{text:"2004年“霍山黄芽”证明商标被省工商局评定为“安徽省著名商标”和“安徽省最受消费者喜爱的商标”称号;"},{text:"2006年霍山黄芽被国家质检总局认定为地理标志保护产品;"},{text:"2007年“霍山黄芽”茶获第七届“中茶杯”全国名优茶评比一等奖;"},{text:"2007年“霍山黄芽”已被列入省级非物质文化遗产名录;"},{text:"2008年“霍山黄芽”茶被评定为“奥运五环茶”，指定作为外国运动员及驻中国使馆专用礼品茶;"},{text:"2008年，霍山黄芽在第七届国际名茶评比(韩国大会)上获得二金一银三项殊荣;2008年霍山黄芽还被指定为国家政协机关用茶;"},{text:"2009年“霍山黄芽”商标被安徽省工商行政管理局认定为安徽省著名商标;"},{text:"2009年霍山黄芽茶在第十六届上海国际茶文化节名茶评比中获金奖。"}]},{name:"霍山黄芽鉴别好茶",content:[{text:"依其品质分为特一级、特二级、一级和二级。外形挺直微展，色泽黄绿披毫，香气清香持久，汤色黄绿明亮，滋味浓厚鲜醇回甘，叶底微黄明亮。"}]}]}}}]);
